  false,\n\t\"url\": null,\n\t\"notes\": \"This map is the result of field investigations
  by DGGS in 1997 and 1998. This geologic map and report supersede the previously
  released Public Data File 1999-24D, Preliminary engineering-geologic map of the
  Healy A-6 Quadrangle, southcentral Alaska. The current map has been updated to include
  mapping of areas adjacent to the Healy A-6 Quadrangle. Field investigations were
  part of a two-year mapping program to provide geologic ground truth for airborne
  geophysical surveys flown by DGGS in the Chulitna region of southcentral Alaska
  during 1996.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"temporal-extent-begin\",\n\t\t\"value\":
